import React from 'react'
import {Link} from 'react-router-dom';

const Navbar = () => {
  return (
  <>
  
        <nav className='main-nav'>
          <Link to="">  About Us   </Link>
          <Link to=""> Contact Us  </Link>
        </nav>

  
  </>
    
  )
}

export default Navbar
